import React from 'react';
import InformationCubes from './InformationCubeComponents/InformationCubes';

export default function Information() {

    return (
        <div className='information-section'>
            <div className='information-section-header'>
                <h1 id='information-section-h1'>Information</h1>
                <div className='information-line'></div>
            </div>
            <div className='information-cubes-grid-layout'>
                <InformationCubes title={'Airport shuffle'} />
                <InformationCubes title={'Taxi pricing'} />
                <InformationCubes title={'Subway map'} />
                <InformationCubes title={'Shoping centers'} />
            </div>
        </div>
    )
}
